INSERT INTO `Product` VALUES ('50', '2', '506998', '2016-05-05 17:36:18', '2016-05-25 16:42:46', '2016-05-05 17:36:18', '意大利公鸡chante clair 除菌抗过敏洗衣液 儿童婴儿宝宝洗衣液', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392556288088.png\" /></p>\r\n\r\n<h2>品牌介绍</h2>\r\n\r\n<p>意大利家喻户晓的清洁品牌Chante Clair是意大利Gruppo Italsilva集团的下属品牌，该集团成立于1908年，Chante Clair的三家生产工厂分别分布在意大利米兰，布雷西亚和摩德纳三座城市，供应全球40多个国家及地区，建立了72个国际合作伙伴，最畅销的Sgrassatore Universale 多功能清洁剂，更是凭借适用范围广，去污性强等特点，占领了意大利同类商品市场50%以上的销售份额。Chante Clair是意大利清洁用品的领军品牌，特别推出的婴幼儿衣物洗护产品，同样得到意大利消费者的认可。</p>\r\n\r\n<h2>小编推荐</h2>\r\n\r\n<p>大公鸡管家婴儿除菌洗衣液采用温和配方，不会刺激宝宝皮肤，同时具有强效除菌的效果，有助于消灭包括绿脓杆菌、大肠杆菌、金黄色葡萄球菌、黑曲霉菌、沙门氏菌等多种细菌以及病毒。温和洁净宝宝衣物，不过敏。</p>\r\n\r\n<h2>参数配置</h2>\r\n\r\n<ul style=\"list-style-type:none\">\r\n	<li>\r\n	<p>商品产地：意大利</p>\r\n	</li>\r\n	<li>\r\n	<p>品牌：大公鸡管家</p>\r\n	</li>\r\n	<li>\r\n	<p>规格：750ml</p>\r\n	</li>\r\n	<li>\r\n	<p>包装：瓶装</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>图文详情</h2>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392595510358.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392608872231.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392622294203.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392630621861.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392641912050.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392650899824.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392664775857.gif\" /></p>\r\n\r\n<p>&nbsp;</p>', '28', '', 'yi-da-li-gong-ji-chante-clair-chu-jun-kang-guo-min-xi-yi-ye-er-tong-ying-er-bao-bao-xi-yi-ye', '1', '0', '2', '');
