INSERT INTO `Product` VALUES ('150', '2', '506535', '2016-05-09 09:58:28', '2016-05-27 09:11:54', '2016-05-09 09:58:28', '意大利原装进口菲斯安娜Felce azzurra香薫沐浴露600ml', '<p><img alt=\"675150152778302087.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160425/1461550270415026.jpg\" /></p>\r\n\r\n<p>此产品蕴含植物精华，有效清洁及去除老化角质，白嫩柔滑，每次沐浴肌肤如享受SPA后变得滋润健康！！！</p>\r\n\r\n<p>Felce Azzurra的是产品的pH值平衡，丰富的保湿剂，赋予生命力和福祉，令肌肤柔软和天鹅绒。</p>\r\n\r\n<p>由于到一个特定的凝胶配方需要照顾你的皮肤无刺激性清洁。</p>\r\n\r\n<p><img src=\"https://images-trading.yilinker.com/Products/201605/572abbb626400.jpg\" style=\"height:178px; width:365px\" /></p>', '8', '', 'yi-da-li-yuan-zhuang-jin-kou-fei-si-an-nuo-felce-azzurraxiang-xun-mu-yu-lu-600ml', '1', '0', '2', '');
