INSERT INTO `Product` VALUES ('152', '2', '506518', '2016-05-09 09:59:25', '2016-05-27 09:56:04', '2016-05-09 09:59:25', '意大利原装进口Chilly女士私处清爽清洁液/护理液凝胶型250ml', '<p><img alt=\"326300910618309777.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160425/1461552799665651.jpg\" /></p>\r\n\r\n<p><strong>1.纯天然专业隐私部位护理液，适合日常女性清洁，特别是在月经周期或大量出汗时使用，有效并且持久防止私处异味。</strong></p>\r\n\r\n<p><strong>2.具有独特舒缓配方，富含芦荟精华和金缕梅提取物，无皂性和低过敏性，温和不刺激，适合敏感性肌肤。</strong></p>\r\n\r\n<p><strong>3.有效减轻因使用卫生巾和性交造成的发红不适。</strong></p>\r\n\r\n<p><strong>4.具有软化和舒缓功效，有助于恢复正常的生理平衡，保护私处粘膜。</strong></p>\r\n\r\n<p><strong>5.弱酸性配方，修复、调整隐私部位的酸性环境。</strong></p>\r\n\r\n<p><strong>6.泡沫细腻，容易冲洗，保持持久清新。</strong></p>\r\n\r\n<p><strong>7.经A.Gi.Co.协会妇科安全认证。</strong></p>\r\n\r\n<p><img src=\"https://images-trading.yilinker.com/Products/201605/572ac029e21bc.jpg\" /></p>', '6', '', 'yi-da-li-yuan-zhuang-jin-kou-chillynu-shi-si-chu-qing-shuang-qing-ji-ye-hu-li-ye-ning-xiao-xing-250ml', '1', '0', '2', '');
