INSERT INTO `Product` VALUES ('200', '2', '506998', '2016-05-09 10:21:03', '2016-05-25 05:44:16', '2016-05-09 10:21:03', '意大利进口FISSAN二合一 婴幼儿童植物洗发水沐浴露', '<table align=\"center\" style=\"width:668px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p>意大利FISSAN婴幼儿强效特润保湿二合一洗发沐浴露</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品品牌：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>FISSAN</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>品牌产地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>意大利</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品产地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>意大利</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品质地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>乳状</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品包装：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>无外盒无密封，长途运输外盒难免有划痕，介意者慎拍&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品规格：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>400ML</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>产品特点：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>专业为宝宝设计的特殊温和配方，不含酒精，不含色素，不含防腐剂，温和不刺激。 加入天然洋甘菊精华，有润肤及舒缓特性，产品温和易被皮肤吸收， 充分提供营养，锁住水份，长达24小时的防护时间，有效保护宝宝娇嫩的肌肤。 百年品牌，真诚奉献。</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"10.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380281587694.jpg\" /></p>\r\n\r\n<p><img alt=\"11.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380289427949.jpg\" /></p>\r\n\r\n<p><img alt=\"12.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380311133827.jpg\" /></p>', '7', '', 'yi-da-li-jin-kou-fissaner-he-ying-you-er-tong-zhi-wu-xi-fa-shui-mu-yu-lu', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('201', '2', '506533', '2016-05-09 10:21:06', '2016-05-27 09:57:07', '2016-05-09 10:21:06', '意大利爱马仕Marvis牙膏', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380874577330.png\" /></p>\r\n\r\n<p>产品介绍： 1、MARVIS牙膏采用经典传统做法，工序复杂，一丝不苟，质感粘稠浓密，味道格外强烈，不止是让你感觉舒爽，更具有保湿及美白功效。 2、MARVIS成功把牙膏概念重新演绎，使简单的护齿变成生活享受，让你天天享有新奇美味体验。 3、 薄荷的冰爽快感，带来持久味觉的刺激，并且发挥强效美白功效，令笑容倍添动人。能提升牙齿珐琅质的抵抗力及保护力，有助预防蛀牙。能去除吸烟，咖啡及饮食所造成的污迹。这支牙膏能让每天都很枯燥的刷牙过程成为一种享受！</p>\r\n\r\n<p>产品特点： 丰富的乳状质地令您的齿颊留香，带给您从未有过的刷牙新感受，并洁净您的牙齿。具有异国情调的甜美的肉桂香型力度上又增加了薄荷的清新，持久的芳香令人喜出望外.</p>\r\n\r\n<p>使用说明： 对于6岁及以下的儿童，摄取使用量为少量，并建议在成年人监督下使用，避免将摄取物吞咽。当有摄取其他来源的含氟产品，需要咨询您的牙科医生。单氟含量：0.14% 注意： 1、可以根据需要使用牙膏，每天一次或早晚一点。 2、所有配方均采用经过认证的有机植物精华配制而成，温和无刺激性，可帮助保持肌肤健康</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383295820063.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383295957860.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383296365413.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383296897174.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383297920744.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383298854587.jpg\" /></p>\r\n\r\n<p><img alt=\"45.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461383349590920.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>', '18', '', 'yi-da-li-ai-ma-shi-marvisya-gao', '1', '0', '2', '');
