INSERT INTO `Product` VALUES ('219', '2', '506535', '2016-05-09 10:29:46', '2016-05-27 09:02:04', '2016-05-09 10:29:46', '瑞士桂芭水晶之密语活力娇嫩美肌沐浴露1080ml', '<table cellpadding=\"0\" cellspacing=\"0\" style=\"width:668px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>品牌：SWEET桂芭&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;名称：水晶之密语活力娇嫩美肌沐浴露1080ml质地：液体状&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;产地：瑞士规格：1080ml &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;市场价：112元保质期：3年&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;外盒包装：有盒无塑封，这款瓶身是透明PVC的，长途运输所以瓶身偶有磨痕划痕，请亲们理解，谢谢！&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>特点功效：&nbsp;本品添加各种天然花草护肤成分,采用香薰理疗技术,完美特润配方,可以进一步滋润干燥的肌肤,同时修复敏感,丰富而细腻的泡沫,令营养深入渗透每一寸肌肤,用后肌肤感觉更加水润柔滑.【适合人群】适合各种肤质使用方法：用温水将身体淋湿后，取适量本品涂于毛巾或者搓澡巾上，轻轻揉搓，直至泡沫丰富后涂抹于全身，按摩2-3分钟，用温水冲洗干净。</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"296941681509795879.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461404458981873.jpg\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462441117563766.jpg\" /></p>', '27', '', 'rui-shi-gui-ba-shui-jing-zhi-mi-yu-huo-li-jiao-nen-mei-ji-mu-yu-lu-1080ml', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('220', '2', '506621', '2016-05-09 10:29:47', '2016-05-24 16:52:14', '2016-05-09 10:29:47', '瑞士进口桂芭沐浴露水晶之密语幽蓝清爽润白沐浴露1080ml', '<p>原产国：瑞士</p>\r\n\r\n<p>品名：桂芭沐浴露</p>\r\n\r\n<p>净含量：1080ml</p>\r\n\r\n<p>产品简介：此款产品像水晶一样之密语幽蓝清爽润白沐浴露</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462450175186226.png\" style=\"height:589px; width:637px\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462450351136572.jpg\" /></p>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" style=\"height:967px; width:668px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>主要成分</td>\r\n			<td>\r\n			<p>离子水 月桂醇聚醚硫酸钠 C12-14烯丙硫磺钠 也有酰胺丙基甜菜碱 乙二醇硬脂酸脂 椰油酰胺MEA DMDN乙内酰脲 EDTA二钠 抗坏血酸柳酸酯二钠 甘油 植三醇 芦荟取物 薄荷提取物.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>主要功效</td>\r\n			<td>\r\n			<p>本品添加各种天然花草护肤成分，采用香蕉理疗技术，营养美白配方，在洁净肌肤的同时，清新的花草芬芳能够令你的心情得到放松，浴后肌肤绽放亮白光彩及无限清爽活力。</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>特点功效</td>\r\n			<td>\r\n			<p>以最接近皮肤特性的原液配方为主，软化角质层、皮屑清污垢，补充水分，平衡皮肤油脂，消炎抗菌，收缩毛孔，肌肤得于清洁而不干痒，同时美白肌肤</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>使用方法</td>\r\n			<td>\r\n			<p>用温水将身体淋湿后，取适量本品涂于沐浴球或者搓澡巾上，轻轻揉搓，直至泡沫丰富后涂于全身，按摩2-3分钟用温水冲洗干净。</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>注意事项</td>\r\n			<td>\r\n			<p>避免接触眼镜，如产品不慎入眼，请即用清水彻底冲洗</p>\r\n\r\n			<p>含有大量植物提取精华，需避光保存，避免阳光直射。</p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', '9', '', 'rui-shi-jin-kou-gui-ba-mu-yu-lu-shui-jing-zhi-mi-yu-you-lan-qing-shuang-run-bai-mu-yu-lu-1080ml', '1', '0', '2', '');
