INSERT INTO `Product` VALUES ('258', '2', '506261', '2016-05-09 10:53:08', '2016-05-26 05:20:29', '2016-05-09 10:53:08', '台湾进口 FARLIN 宽口径PP奶瓶270ml+防胀气硅胶', '<p><img src=\"http://119.37.197.41:4869/80da69f02a3ad8c9d4de403dc758b242?w=400&amp;h=400\" /></p>\r\n\r\n<p>原产地：台湾进口&nbsp;</p>\r\n\r\n<p>品牌：FARLIN&nbsp;</p>\r\n\r\n<p>产品简介：宽口径PP奶瓶270ml，防胀气，天然硅胶。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>来自台湾 四十年传承</strong></p>\r\n\r\n<p><strong>依托道周医院的专业数据研发最适合宝宝的哺育用品...... 在全球八十多个国家各大型百货有售;</strong></p>\r\n\r\n<p><strong>统一按欧盟标准生产（全球最高标准）</strong></p>\r\n\r\n<p><strong>黄金三角奶嘴具备防胀气、去舌苔、可伸缩功能 奶瓶瓶身德国进口，抗骤变温差180度。</strong></p>\r\n\r\n<p><img src=\"http://119.37.197.41:4869/0678ed1899f9a0b949ca54d3302595b6?w=400&amp;h=400\" /><img alt=\"blob.png\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462442735436969.png\" /><img alt=\"blob.png\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462442778590786.png\" /><img alt=\"blob.png\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462442805957593.png\" /><img alt=\"blob.png\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462442824502155.png\" /></p>', '9', '', 'tai-wan-jin-kou-farlin-kuan-kou-jing-ppnai-ping-270ml-fang-zhang-qi-huo-xiao', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('259', '2', '506998', '2016-05-09 10:53:09', '2016-05-26 17:01:04', '2016-05-09 10:53:09', '韩国进口phyll/必尔柔软奶嘴升级版 1~5阶段 不含双酚A 1只装', '<ul style=\"list-style-type:none\">\r\n	<li>\r\n	<p>材质：硅胶</p>\r\n	</li>\r\n	<li>\r\n	<p><img src=\"http://119.37.197.41:4869/00639b0ee9a890285742268b78526374?w=400&amp;h=400\" /></p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong><strong>【</strong>品名】phyll柔软奶嘴 1～５阶段（升级版）1只装</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>【</strong>材质】</strong><strong>液体硅胶</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;耐热/耐冷温度：120℃~-20℃</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【适合阶段】1段，1个孔（0-3个月）</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2段，2个孔（3-7个月）</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3段，3个孔（7个月以上）</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4段，4个孔（10个月以上）</strong></p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 5段，Y型孔（辅食用，多功能）</strong></p>\r\n\r\n<p>【功能性】</p>\r\n\r\n<p>1、母乳般超柔软奶嘴，伸展性好，宝宝更容易接受</p>\r\n\r\n<p>2、奶嘴头采用双环式设计，咬合力更加，有助于上下颌发育和预防虎牙<br />\r\n3、仿母乳丰满弧线设计，宝宝更有亲密感</p>\r\n\r\n<p>4、奶嘴底部的排气系统，有效防止奶嘴扁塌，宝宝吃奶顺畅自如</p>\r\n\r\n<p>5、采用医用液体硅胶制成，安全放心</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>【产品特点】</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>产品特点：</strong></p>\r\n\r\n<p><strong>1.奶嘴使用经过美国FDA认证的安全硅胶材质</strong></p>\r\n\r\n<p><strong>2.部分添加自动抑菌的纳米银成分</strong></p>\r\n\r\n<p><strong>3.奶嘴符合亚洲婴童的口腔形状</strong></p>\r\n\r\n<p><strong>4.不含环境内分泌干扰物BPA（双酚A)</strong></p>\r\n\r\n<p><strong>5.仿真妈妈乳头触感，有效减少婴童排斥感</strong></p>\r\n\r\n<p><strong>6.锥形透气孔防胀气设计，杜绝胀气现象</strong></p>\r\n\r\n<p><strong>7.牙医推荐防虎牙双环设计</strong></p>\r\n\r\n<p><strong>8.恰当奶嘴长度预防中耳炎</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>注意事项：</strong></p>\r\n\r\n<p><strong>请远离火源</strong></p>\r\n\r\n<p><strong>喂奶时，奶瓶角度尽量保持45&deg;角</strong></p>\r\n\r\n<p><strong>建议每2个月更换新奶嘴，如发现奶嘴破损、变粘时，请及时更换新品</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>消毒方式：</strong></p>\r\n\r\n<p><strong>煮沸消毒时间1分钟为宜</strong></p>\r\n\r\n<p><strong>蒸汽消毒锅或微波炉消毒</strong></p>\r\n\r\n<p>&nbsp;<strong>温馨提示：</strong></p>\r\n\r\n<p><strong>如发现奶嘴有吸不出水或吸扁现象，请检查奶瓶是否拧得过紧，并用奶嘴针对奶嘴及呼吸调节垫的透气孔进行疏通，使透气孔保持通畅、首先检查奶嘴边上的透气孔，用类似针的东西把透气孔通开，因为奶嘴是硅胶的，吸附性比较强，使用前还是要检查是否畅通，以免堵塞导致奶嘴吸不上</strong></p>\r\n\r\n<p>&nbsp;</p>', '60', '', 'han-guo-jin-kou-phyll-bi-er-rou-ruan-nai-zui-sheng-ji-ban-1-5jie-duan-bu-han-shuang-fen-a-1zhi-zhuang', '1', '0', '2', '');
