INSERT INTO `Product` VALUES ('393', '70', '506998', '2016-05-12 14:09:02', '2016-05-22 22:40:03', '2016-05-12 14:09:02', '意大利进口FISSAN二合一 婴幼儿童植物洗发水沐浴露', '<table align=\"center\" style=\"width:668px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p>意大利FISSAN婴幼儿强效特润保湿二合一洗发沐浴露</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品品牌：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>FISSAN</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>品牌产地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>意大利</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品产地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>意大利</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品质地：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>乳状</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品包装：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>无外盒无密封，长途运输外盒难免有划痕，介意者慎拍&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品规格：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>400ML</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>产品特点：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>专业为宝宝设计的特殊温和配方，不含酒精，不含色素，不含防腐剂，温和不刺激。 加入天然洋甘菊精华，有润肤及舒缓特性，产品温和易被皮肤吸收， 充分提供营养，锁住水份，长达24小时的防护时间，有效保护宝宝娇嫩的肌肤。 百年品牌，真诚奉献。</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img alt=\"10.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380281587694.jpg\" /></p>\r\n\r\n<p><img alt=\"11.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380289427949.jpg\" /></p>\r\n\r\n<p><img alt=\"12.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461380311133827.jpg\" /></p>', '0', '', 'yi-da-li-jin-kou-fissaner-he-ying-you-er-tong-zhi-wu-xi-fa-shui-mu-yu-lu-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('394', '70', '506998', '2016-05-12 14:09:05', '2016-05-22 22:50:02', '2016-05-12 14:09:05', '意大利原装正品Fissan 宝宝特润面霜/润肤乳/乳霜升级版', '<p><img src=\"http://i04.c.aliimg.com/img/ibank/2015/259/220/1934022952_541823713.jpg?__r__=1421511200020\" /></p>\r\n\r\n<p><img src=\"http://i05.c.aliimg.com/img/ibank/2015/051/921/1931129150_541823713.jpg?__r__=1421511200021\" /></p>\r\n\r\n<p><img src=\"http://i04.c.aliimg.com/img/ibank/2015/869/220/1934022968_541823713.jpg?__r__=1421511200021\" /></p>\r\n\r\n<p>FISSAN品牌于1924年创立意大利，专业生产婴幼儿洗护用品80多年，行销欧洲80余年历史，行销据点分布于世界各国，长久以来FISSAN商品以其十足专业性婴幼商品，深受欧洲消费者的信赖与肯定，成为欧洲婴幼儿产品的顶级品牌。</p>\r\n\r\n<p>FISSAN 特滋润面霜升级版，宝宝第一品牌，</p>\r\n\r\n<p>最新包装!Fissan是滋补水化和保护，</p>\r\n\r\n<p>确保婴儿和儿童微妙的敏感肌肤。它的温和配方，富含甘油，</p>\r\n\r\n<p>补水持续24小时，并帮助维持肌肤的天然水分平衡。</p>\r\n\r\n<p>每天使用滋润面霜免受外来侵略</p>\r\n\r\n<p>手和脸部经常使用，并有助于防止皮肤干燥</p>\r\n\r\n<p>0岁就可以使用！大人也能用！超级滋润！</p>\r\n\r\n<p>绝对0%防腐剂、0%化学染色剂、0%酒精，低过敏配方</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'yi-da-li-yuan-zhuang-zheng-pin-fissan-bao-bao-te-run-mian-shuang-run-fu-ru-ru-shuang-sheng-ji-ban-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('395', '70', '506998', '2016-05-12 14:09:08', '2016-05-22 22:50:03', '2016-05-12 14:09:07', '正品法国 Mustela妙思乐维他命换片护肤膏123 护臀霜', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461397745777753.jpg\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461397755385227.jpg\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461397760642726.jpg\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461397764767470.jpg\" /><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461397772842081.jpg\" /></p>', '0', '', 'zheng-pin-fa-guo-mustelamiao-si-le-wei-ta-ming-huan-pian-hu-fu-gao-123-hu-tun-shuang-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('396', '87', '506998', '2016-05-12 14:18:18', '2016-05-23 15:10:02', '2016-05-12 14:18:18', '意大利公鸡chante clair 除菌抗过敏洗衣液 儿童婴儿宝宝洗衣液', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392556288088.png\" /></p>\r\n\r\n<h2>品牌介绍</h2>\r\n\r\n<p>意大利家喻户晓的清洁品牌Chante Clair是意大利Gruppo Italsilva集团的下属品牌，该集团成立于1908年，Chante Clair的三家生产工厂分别分布在意大利米兰，布雷西亚和摩德纳三座城市，供应全球40多个国家及地区，建立了72个国际合作伙伴，最畅销的Sgrassatore Universale 多功能清洁剂，更是凭借适用范围广，去污性强等特点，占领了意大利同类商品市场50%以上的销售份额。Chante Clair是意大利清洁用品的领军品牌，特别推出的婴幼儿衣物洗护产品，同样得到意大利消费者的认可。</p>\r\n\r\n<h2>小编推荐</h2>\r\n\r\n<p>大公鸡管家婴儿除菌洗衣液采用温和配方，不会刺激宝宝皮肤，同时具有强效除菌的效果，有助于消灭包括绿脓杆菌、大肠杆菌、金黄色葡萄球菌、黑曲霉菌、沙门氏菌等多种细菌以及病毒。温和洁净宝宝衣物，不过敏。</p>\r\n\r\n<h2>参数配置</h2>\r\n\r\n<ul style=\"list-style-type:none\">\r\n	<li>\r\n	<p>商品产地：意大利</p>\r\n	</li>\r\n	<li>\r\n	<p>品牌：大公鸡管家</p>\r\n	</li>\r\n	<li>\r\n	<p>规格：750ml</p>\r\n	</li>\r\n	<li>\r\n	<p>包装：瓶装</p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>图文详情</h2>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392595510358.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392608872231.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392622294203.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392630621861.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392641912050.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392650899824.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461392664775857.gif\" /></p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'yi-da-li-gong-ji-chante-clair-chu-jun-kang-guo-min-xi-yi-ye-er-tong-ying-er-bao-bao-xi-yi-ye-2', '1', '0', '2', '');
