INSERT INTO `Product` VALUES ('400', '87', '506998', '2016-05-12 14:18:27', '2016-05-22 23:10:03', '2016-05-12 14:18:27', '韩国进口 phyll—安心玻璃奶瓶2阶段', '<p><img src=\"http://119.37.197.41:4869/fefbb1c1cbcee1ca1b1d2869bbd7a453?w=400&amp;h=400\" /></p>\r\n\r\n<p><strong>phyll&mdash;&mdash;安心玻璃奶瓶2阶段</strong></p>\r\n\r\n<p>容量: 260ml(宽口)</p>\r\n\r\n<p>产品特点</p>\r\n\r\n<p>1、采用玻璃材质,在高温情况下,也不会释放有毒物质或环境内分泌干扰物。</p>\r\n\r\n<p>2、方便清洁奶渍和污垢,抑制细菌繁殖,持久保持清洁卫生。</p>\r\n\r\n<p>3、不易产生划痕,不退色,可长期重复使用。</p>\r\n\r\n<p>4、奶瓶的上端和下端分别采用硅胶抗摔防护圈,有效抵抗外部冲击,降低玻璃易碎的风险性。</p>\r\n\r\n<p>5、宽口设计方便妈妈调奶,避免奶粉外撒。</p>\r\n\r\n<p>使用说明</p>\r\n\r\n<p>沸水消毒时间请勿超过一分钟。</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'han-guo-jin-kou-phyll-an-xin-bo-li-nai-ping-2jie-duan-2', '1', '0', '2', '');
