INSERT INTO `Product` VALUES ('445', '2', '506772', '2016-05-12 15:17:05', '2016-05-25 23:56:51', '2016-05-12 15:17:05', '匈牙利原瓶进口1881酷威红葡萄酒750ml', '<p>酒精度：14% &nbsp;规格：750ml</p>\r\n\r\n<p>品饮温度：16-18℃，醒酒半小时</p>\r\n\r\n<p>与奶酪、烤肉、炖肉品饮。</p>\r\n\r\n<p>这款深深的红宝石色、丝绒口感的红葡萄酒营造出地中海生活的欢乐、舒适与和谐的情绪氛围。她用丰富的水果芳香呈现了维拉尼葡萄酒区得天独厚的天赐，用忠诚答谢以愉悦心情和以专业热爱酿造她的酿造者。</p>\r\n\r\n<p>建议品饮温度：16-18度。</p>\r\n\r\n<p>建议配餐：奶酪、烤肉、炖肉品饮。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"_MG_0056 拷贝.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160506/1462514573394941.jpg\" /></p>\r\n\r\n<p><img alt=\"_MG_1165.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160506/1462519088490560.jpg\" style=\"height:1352px; width:662px\" /></p>\r\n\r\n<p><img alt=\"_MG_1166.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160506/1462519079950756.jpg\" style=\"height:1320px; width:677px\" /></p>\r\n\r\n<p><img alt=\"_MG_1164.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160506/1462519095681174.jpg\" style=\"height:1470px; width:680px\" /></p>\r\n\r\n<p>&nbsp;</p>', '9', '', 'xiong-ya-li-yuan-ping-jin-kou-1881ku-wei-hong-pu-tao-jiu-750ml', '1', '0', '2', '');
