INSERT INTO `Product` VALUES ('454', '2', '506774', '2016-05-12 15:20:14', '2016-05-24 15:32:06', '2016-05-12 15:20:14', '匈牙利原瓶进口托卡伊阿苏6篓1999甜型贵腐500ml', '<p>经典的托卡伊年份。酒色熔金，酒气芳香，让人感受到葡萄干、杏蜜饯、核桃的果香和传统阿苏酒的完美特征。口感舒适，回味悠长。带着细腻的矿与榅桲的味道，有着出众、完美的平衡。</p>\r\n\r\n<p>酒色熔金，酒气芳香：有葡萄干、杏蜜饯、核桃的果香和传统阿苏酒的完美特征。甜而不腻，回味悠长。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462779721565501.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462779727983534.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462779733469993.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '16', '', 'xiong-ya-li-yuan-ping-jin-kou-tuo-qia-yi-a-su-6lou-1999tian-xing-gui-fu-500ml', '1', '0', '2', '');
