INSERT INTO `Product` VALUES ('456', '2', '507040', '2016-05-12 15:20:16', '2016-05-21 07:40:21', '2016-05-12 15:20:16', '匈牙利原瓶进口托卡伊阿苏6篓2007甜型贵腐500ml', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462781320439906.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462781322439050.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462781336513775.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462781357485906.jpg\" /></p>\r\n\r\n<p>酒色亮金，熠熠泛光。酒香芬芳，浓郁，带有咖啡、蜂蜜、茶和大枣的味道。酒味复杂而和谐，有阿苏化水果和东方调料的神秘韵味，余味悠长，品后难忘。</p>', '6', '', 'xiong-ya-li-yuan-ping-jin-kou-tuo-qia-yi-a-su-6lou-2007tian-xing-gui-fu-500ml', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('457', '2', '506774', '2016-05-12 15:20:19', '2016-05-19 14:13:28', '2016-05-12 15:20:19', '匈牙利原瓶进口 托卡伊阿苏5篓2000甜型贵腐500ml', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462782959109241.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462782969734681.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462782981592269.jpg\" /></p>\r\n\r\n<p>2000年是一个非常好的贵腐酒年份。这款是霍洛克酒庄经典之一酒色熔金，酒气芳香：酒味中混合了成熟浆果、葡萄干、杏蜜饯、核桃、李子、新咖啡和矿物质的味道，口感柔顺厚重，回味深沉悠长。高雅，大气，出众，完美。</p>', '7', '', 'xiong-ya-li-yuan-ping-jin-kou-tuo-qia-yi-a-su-5lou-2000tian-xing-gui-fu-500ml', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('458', '2', '507040', '2016-05-12 15:20:20', '2016-05-25 14:19:20', '2016-05-12 15:20:20', '匈牙利原瓶进口 托卡伊福尔明2009半甜型白葡萄酒750ml', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462784501917319.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462784504541282.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462784506518012.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462784521550398.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462784550811633.jpg\" /></p>\r\n\r\n<p>这是一款在不锈容器里发酵浓醇、厚重的白葡萄酒，保持了水果原始的芳香。最适于跟甜点配饮，或在交谈时小酌。不少葡萄酒爱好者陶醉于这款酒爽心怡神的糖分唤起的愉悦感受。</p>', '7', '', 'xiong-ya-li-yuan-ping-jin-kou-tuo-qia-yi-fu-er-ming-2009ban-tian-xing-bai-pu-tao-jiu-750ml', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('459', '2', '507040', '2016-05-12 15:20:55', '2016-05-27 09:03:48', '2016-05-12 15:20:55', '匈牙利原瓶进口 托卡伊黄穆斯卡2011干型白葡萄酒750ml', '<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462802184502650.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462802195956246.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462802195765941.jpg\" /></p>\r\n\r\n<p>酒体浓郁，回味悠久。喝完了，空杯仍保持持久幽香。酒味中飘扬着清扬，独特的果香。丰富了我们人类美好，精妙的味觉世界。由于产地的得天独厚，使得此款葡萄酒富含矿物质，喝完20分钟左右，嘴内还能感觉到略有咸味，这是葡萄酒富含矿物质的最佳表现！这款干白，颜色晶莹剔透，保留了很漂亮的小麦色，是非常难得的。空杯近一小时后，仍然留香，这种品质在白葡萄酒中极为少见！</p>', '86', '', 'xiong-ya-li-yuan-ping-jin-kou-tuo-qia-yi-huang-mu-si-qia-2011gan-xing-bai-pu-tao-jiu-750ml', '1', '0', '2', '');
