INSERT INTO `Product` VALUES ('553', '2', '506535', '2016-05-18 10:00:25', '2016-05-25 03:09:14', '2016-05-18 10:00:25', '意大利原装进口菲斯安娜Felce azzurra香薫沐浴露600ml', '<p><img alt=\"215689031644743990.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160425/1461549748692711.jpg\" />&nbsp; &nbsp;</p>\r\n\r\n<p>此产品蕴含植物精华，有效清洁及去除老化角质，白嫩柔滑，每次沐浴肌肤如享受SPA后变得滋润健康！！！此产品蕴含植物精华，有效清洁及去除老化角质，白嫩柔滑，每次沐浴肌肤如享受SPA后变得滋润健康！！！<img src=\"https://images-trading.yilinker.com/Products/201605/572aba5345eda.jpg\" style=\"height:262px; width:304px\" /></p>\r\n\r\n<p>【产品功效】： 1. 润肤清爽，清新怡神。 2、植物爽肤精华在深层净化肌肤的同时又不举令肌肤干燥紧绷，令您充分享受清新舒爽的沐浴体验。 3、在彻底清除皮肤污垢的同时迅速止痒，有效清除多种有害物质，防止皮肤瘙痒。 此产品蕴含植物精华，有效清洁及去除老化角质，白嫩柔滑，每次沐浴肌肤如享受SPA后变得滋润健康！！！ Felce Azzurra的是产品的pH值平衡，丰富的保湿剂，赋予生命力和福祉，令肌肤柔软和天鹅绒。 由于到一个特定的凝胶配方需要照顾你的皮肤无刺激性清洁。</p>', '4', '', 'yi-da-li-yuan-zhuang-jin-kou-fei-si-an-nuo-felce-azzurraxiang-xun-mu-yu-lu-600ml-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('554', '2', '506535', '2016-05-18 10:00:28', '2016-05-27 09:59:44', '2016-05-18 10:00:27', '意大利原装进口菲斯安娜Felce azzurra香薫沐浴露600ml', '<p><img alt=\"179535722056442488.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160425/1461550031298668.jpg\" /></p>\r\n\r\n<p>此产品蕴含植物精华，有效清洁及去除老化角质，白嫩柔滑，每次沐浴肌肤如享受SPA后变得滋润健康！！！</p>\r\n\r\n<p>Felce Azzurra的是产品的pH值平衡，丰富的保湿剂，赋予生命力和福祉，令肌肤柔软和天鹅绒。</p>\r\n\r\n<p><img src=\"https://images-trading.yilinker.com/Products/201605/572abeae8bdff.jpg\" style=\"height:261px; width:369px\" /></p>', '7', '', 'yi-da-li-yuan-zhuang-jin-kou-fei-si-an-nuo-felce-azzurraxiang-xun-mu-yu-lu-600ml-2', '1', '0', '2', '');
