INSERT INTO `Product` VALUES ('571', '2', '506765', '2016-05-18 10:13:52', '2016-05-25 15:00:03', '2016-05-18 10:13:52', '海太POP椰果混合果汁饮料  进口食品  原产国韩国  238ml', '<p><strong>商品描述</strong><br />\r\n&nbsp;&nbsp;&nbsp; 海太果肉果汁饮料均由新鲜水果制作，口感好，清冽爽口，享受美味的同时，净化身心，是口感清爽的饮品！</p>\r\n\r\n<p><strong>品牌介绍</strong><br />\r\n&nbsp;&nbsp;&nbsp; 海太饮料成立于1973年，是韩国国内较早开发天然果汁饮料的企业，专门开发和生产高品质饮料产品的生产厂家。海太饮料作为韩国三大著名饮料品牌之一的企业，多年以来，在韩国国内主导果汁市场，赢得果汁名家的口碑。新研制的海太POP系列果汁有水蜜桃、菠萝、芒果、香蕉、车厘子、草莓、橙、苹果、葡萄、什果等多种口味，里面都含有椰果果肉，特选高级鲜果，较大限度地保证果肉的完整性，彻底让消费者感受到&ldquo;汁中有肉，肉中有汁&rdquo;的独特奇妙口感。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462453687262681.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462453690193560.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462453696818025.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462453750477644.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>', '2', '', 'hai-tai-popye-guo-hun-he-guo-zhi-yin-liao-jin-kou-shi-pin-yuan-chan-guo-han-guo-238ml', '1', '0', '2', '');
