INSERT INTO `Product` VALUES ('686', '117', '506998', '2016-05-20 19:57:33', '2016-05-22 22:50:03', '2016-05-20 19:57:33', '意大利原装正品Fissan 宝宝特润面霜/润肤乳/乳霜升级版', '<p><img src=\"http://i04.c.aliimg.com/img/ibank/2015/259/220/1934022952_541823713.jpg?__r__=1421511200020\" /></p>\r\n\r\n<p><img src=\"http://i05.c.aliimg.com/img/ibank/2015/051/921/1931129150_541823713.jpg?__r__=1421511200021\" /></p>\r\n\r\n<p><img src=\"http://i04.c.aliimg.com/img/ibank/2015/869/220/1934022968_541823713.jpg?__r__=1421511200021\" /></p>\r\n\r\n<p>FISSAN品牌于1924年创立意大利，专业生产婴幼儿洗护用品80多年，行销欧洲80余年历史，行销据点分布于世界各国，长久以来FISSAN商品以其十足专业性婴幼商品，深受欧洲消费者的信赖与肯定，成为欧洲婴幼儿产品的顶级品牌。</p>\r\n\r\n<p>FISSAN 特滋润面霜升级版，宝宝第一品牌，</p>\r\n\r\n<p>最新包装!Fissan是滋补水化和保护，</p>\r\n\r\n<p>确保婴儿和儿童微妙的敏感肌肤。它的温和配方，富含甘油，</p>\r\n\r\n<p>补水持续24小时，并帮助维持肌肤的天然水分平衡。</p>\r\n\r\n<p>每天使用滋润面霜免受外来侵略</p>\r\n\r\n<p>手和脸部经常使用，并有助于防止皮肤干燥</p>\r\n\r\n<p>0岁就可以使用！大人也能用！超级滋润！</p>\r\n\r\n<p>绝对0%防腐剂、0%化学染色剂、0%酒精，低过敏配方</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'yi-da-li-yuan-zhuang-zheng-pin-fissan-bao-bao-te-run-mian-shuang-run-fu-ru-ru-shuang-sheng-ji-ban-2', '1', '0', '2', '');
