INSERT INTO `Product` VALUES ('821', '122', '506660', '2016-05-21 10:58:57', '2016-05-21 19:50:06', '2016-05-21 10:58:57', '正品韩国进口 爱敬2080清凉牙膏120g 绿茶清爽香味6311有效杀菌消异味', '<p>韩国直邮 爱敬2080清凉牙膏120g</p>\r\n\r\n<p>绿茶清爽香味</p>\r\n\r\n<p>宝贝产地：韩国</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2080牙膏在韩剧《浪漫满屋》里主角用过之后，在韩国和台湾地区大卖，此款牙膏也在韩国连续三年排在同等产品第一位。</p>\r\n\r\n<p>以爱敬多年的生产经验开发出的产品，争取实现将20岁的健康牙齿保持到80岁的梦想。</p>\r\n\r\n<p>2080牙膏的主要成分维生素、二氧化硅、磷酸钠能有效预防龋齿和其它牙齿疾患</p>\r\n\r\n<p>&ldquo;将20岁的健康牙齿保持到80岁&rdquo;的2080运动是全民性的牙齿健康运动。<img alt=\"\" src=\"http://119.37.197.41:4869/94424f5d9e78e4003df8eda45fba4227\" /><img alt=\"\" src=\"http://119.37.197.41:4869/737818b6cc07db4da61791498821c5b0\" /><img alt=\"\" src=\"http://119.37.197.41:4869/0c0c4afed839822540734d205cbd438e\" /><img alt=\"\" src=\"http://119.37.197.41:4869/4e70895ae06fcc2b33a577d5ead26c2d\" /></p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'zheng-pin-han-guo-jin-kou-ai-jing-2080qing-liang-ya-gao-120g-lu-cha-qing-shuang-xiang-wei-6311you-xiao-sha-jun-xiao-yi-wei-5', '1', '0', '2', '');
