INSERT INTO `Product` VALUES ('874', '120', '506741', '2016-05-23 14:23:16', '2016-05-25 16:20:03', '2016-05-23 14:23:16', '韩美禾扁桃仁瓦夫108g', '<table cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>品牌:&nbsp;<a href=\"http://www.lingshi.com/list/?pinpai=735&amp;oderAsc=hotasc\">韩美禾</a></td>\r\n			<td>韩美禾扁桃仁瓦夫108g</td>\r\n			<td>产 地：<a href=\"http://www.lingshi.com/list/?region=149&amp;oderAsc=hotasc\">韩国</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>毛重: 160克</td>\r\n			<td>种类：饼干</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>保质期：12个月</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>酥脆爽口，丝滑香椿！没错，说的就是它，韩美禾扁桃仁瓦夫~</p>\r\n\r\n<p>优选韩国进口原料，营养美味，轻松享受健康美好生活。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>浓浓的瓦夫是鸡蛋和面粉的完美组合，浓郁的香味，诱人的色泽，地道的韩国风味。韩国的秘制烘烤技术，精选原材料金黄的烘烤表皮，口感香浓超级美味。全麦面粉精致而成，香香酥酥的。增强饱腹感，热量低而且营养又好吃！</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>配料：小麦粉、植物油、白砂糖、起酥油、黑芝麻、鸡蛋等。</p>\r\n\r\n<p>食用方法：打开即食。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461390588975243.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461390595384189.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461390609878095.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461390615490251.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461390629910063.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'han-mei-he-bian-tao-ren-wa-fu-108g-5', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('875', '120', '506741', '2016-05-23 14:23:19', '2016-05-25 16:20:04', '2016-05-23 14:23:19', '韩国可拉奥榛子巧克力威化', '<p>品名：CROWN可拉奥巧克力榛子瓦 净重：47g 产地：韩国 配料表：小麦粉，精制加工油脂，白糖，乳清粉末，巧克力，榛子粉。 韩国的小食品延续了韩国饮食的文化。在营养搭配和口味上都有其独到之处，这款蛋卷酥皮是用榛子磨的面制作而成,内层混合巧克力夹心，营养又健康，一个蛋卷是两块，轻轻从中间扳开，这款美味小食品不仅可口，而且可爱的外包装设计的也很美噢！ 【榛子的营养】： 榛子营养丰富，果仁中出除含有蛋白质、脂肪、糖类外，胡萝卜素、维生素B1 、维生素B2、维生素E含量也很丰富；榛子中人体所需的8种氨基酸样样俱全，其含量远远高过核桃；榛子中各种微量元素如钙、磷、铁含量也高于其他坚果。此外，它也可以生产十分珍贵的木材，其木材坚硬，纹理、色泽美观，可做小型细木工的材料；部分品种可作植被恢复及园林绿化树种。榛子富含油脂（大多为不饱和脂肪酸）、蛋白质、碳水化合物、生素维（维生素E）、矿物质、糖纤维、&beta;--古甾醇和抗氧剂石炭酸等特殊成分以及人类所需的八种氨基酸与微量元素。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393841850365.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393846287796.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393852569993.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393857433269.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393860703091.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393866922997.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393880159553.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160423/1461393886728245.jpg\" /></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'han-guo-ke-la-ao-zhen-zi-qiao-ke-li-wei-hua-7', '1', '0', '2', '');
