INSERT INTO `Product` VALUES ('891', '2', '506747', '2016-05-24 09:33:28', '2016-05-25 18:18:32', '2016-05-24 09:33:28', '越南丹帝牌盐味什锦果仁1kg', '<p>&nbsp;</p>\r\n\r\n<p>【产品介绍】</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>丹帝是加拿大卓越的食品生产商，总部坐落于美丽的卑诗省，丹帝一直致力于为全球提供高品质的食品。丹帝在全球的工厂都采用统一的高品质管理标准，符合质量部门、CCOF、ISO等认证, 对品质的承诺是丹帝的首要任务。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>丹帝腰果不但肥厚饱满，而且口感极好。入口香甜酥脆，吃后齿狭生香，回味无穷。更有多种口味，香甜咸脆，款款经典，老少皆宜。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>腰果中的脂肪成分主要是不饱和脂肪，而不饱和脂肪主要由单不饱和脂肪酸组成，单不饱和脂肪酸可降低血中胆固醇、甘油三酯和低密度脂蛋白含量，增加高密度脂蛋白含量，没有多不饱和脂肪酸致癌、促进机体脂质过氧化等潜在的不良反应，因此对心脑血管大有益处。腰果含有丰富的油脂，可以润肠通便，并有很好的润肤美容的功效，能延缓衰老。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>腰果含丰富的维生素A，是优良的抗氧化剂，能使皮肤有光泽、气色变好。</p>\r\n\r\n<p>腰果还具有催乳的功效，有益于产后乳汁分泌不足的妇女。</p>\r\n\r\n<p>腰果中含有大量的蛋白酶抑制剂，能控制癌症病情。</p>\r\n\r\n<p>经常食用腰果有强身健体、提高机体抗病能力、增进食欲、增加体重等作用。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876334498489.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876334111856.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876341550632.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876344407233.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876348989781.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462876352897408.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '3', '', 'yue-nan-dan-di-pai-yan-wei-shi-jin-guo-ren-1kg', '1', '0', '2', '');
