INSERT INTO `Product` VALUES ('913', '2', '506790', '2016-05-24 09:46:01', '2016-05-25 18:20:02', '2016-05-24 09:46:01', '盛田酵素', '<p>&nbsp;</p>\r\n\r\n<p>产地：日本</p>\r\n\r\n<p>规格：30包（1月装）</p>\r\n\r\n<p>推荐指数：★★★★★</p>\r\n\r\n<p>★特点：使用75种日本各地特产时令蔬果，发酵三年制成。没有一滴水，不加白砂糖，味道好，活性高，是难得的优质浓缩发酵精华液！</p>\r\n\r\n<p>重病人群、亚健康人群及想要瘦身美颜的女性都非常推荐!</p>\r\n\r\n<p>★服用方法：</p>\r\n\r\n<p>1)常规保健：饭前 30 分钟，常温水（不超过40度）6-8 倍稀释饮用。每天 1 包。也可直接饮用。</p>\r\n\r\n<p>2)饮用方法多种多样：用牛奶、豆浆稀释&hellip; 1杯（将20ml加入到1800cc牛奶或豆浆中饮用）加入到奶酪中饮用，也可混于45度以下饮料，茶，果汁等产品中饮用。</p>\r\n\r\n<p>3)瘦身美体：每天饮用酵素 1包 代替晚餐，常温水 6-8 倍稀释饮用。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462840220328175.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462840220395353.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462840220199959.gif\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160510/1462840221387864.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '1', '', 'sheng-tian-xiao-su', '1', '0', '2', '');
