INSERT INTO `Product` VALUES ('917', '2', '507019', '2016-05-24 09:47:06', '2016-05-27 09:55:24', '2016-05-24 09:47:06', '日本FX眼药水银12ml', '<h2>宝贝详情：</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>能够迅速缓解眼睛疲劳干涩和消退红血丝。让你眼睛瞬间黑白分明、清澈明亮、魅力四射。采用独有配方，缓解眼部疲劳，特别是对用眼过度超级有效果。强效清凉感，让眼睛和头脑都迅速得到清爽舒缓，结膜充血状况也迅速消除。对眼睛痒和其他眼部疾病也有预防作用。并能缓解佩戴隐形眼镜而造成的不快。</p>\r\n\r\n<p><strong>注意事项:</strong></p>\r\n\r\n<p>&nbsp;&nbsp;1.&nbsp;密封保存，避免阳光直射&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;2.&nbsp;放置在儿童不易拿到的地方</p>\r\n\r\n<p>&nbsp;&nbsp;3.&nbsp;不要使用其他容器保存&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;4.&nbsp;不要和他人共用</p>\r\n\r\n<p>&nbsp;&nbsp;5.&nbsp;注意产品的保质期限（包装盒下面）</p>\r\n\r\n<p>&nbsp;&nbsp;6.&nbsp;开封后请在2至3个月内用完</p>\r\n\r\n<p>用法与用量：每次1～3滴，每日3～6次</p>\r\n\r\n<p><img alt=\"1462930792305979 (1).jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160511/1462948729890933.jpg\" /></p>\r\n\r\n<p><img src=\"https://images-trading.yilinker.com/Products/201605/57327a7b0408e.jpg\" /><img src=\"https://images-trading.yilinker.com/Products/201605/57327a7b0437f.jpg\" /></p>', '6', '', 'ri-ben-fxyan-yao-shui-yin-12ml', '1', '0', '2', '');
