INSERT INTO `Product` VALUES ('966', '2', '506526', '2016-05-24 12:28:11', '2016-05-27 10:02:18', '2016-05-24 12:28:11', '韩国润膏洗发护发二合一250ml', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>产品成分主原料：</strong></p>\r\n\r\n<p>以苦参、细辛、桑白皮、黄莲、白芍、山茱萸等，不含任何硅等化学物质成分，以中草药熬制而成，营养保湿、防脱、香润清洁、洗护二合一</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>主调：</strong></p>\r\n\r\n<p>以梅花、金银花、莲花、石榴等野生花香为主调，香气淡雅 COCO味。而西印度醋栗，绿豆等成分会让你常年由于染发，烫发而损伤的蓬乱毛发恢复健康自然润泽。红参的SAPONIN成分会生成细腻丰富泡沫，深层清理头皮屑维护发囊卫生，有效防脱发！</p>\r\n\r\n<p>韩国润膏洗发护发二合一250ml</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"TB2r.zbnXXXXXcyXXXXXXXXXXXX_!!2431245078.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462441061890742.jpg\" /></p>\r\n\r\n<p><img alt=\"572b17196a787.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462448768635613.jpg\" /><img alt=\"571af3059568a.jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160505/1462448795619232.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '4', '', 'han-guo-run-gao-xi-fa-hu-fa-er-he-250ml', '1', '0', '2', '');
