INSERT INTO `Product` VALUES ('1067', '172', '506486', '2016-05-26 14:45:17', '2016-05-26 14:45:17', '2016-05-26 14:45:17', '法国兰蔻Lancome清滢嫩肤水(中性)400ML+400ML两件套', '<p>兰蔻&nbsp;（Lanc&ocirc;me）源自法国的世界顶级化妆品牌，致力于成就全球女性的奢华风尚，优雅气质。于1935年诞生于法国，现在LANCOME属于世界第一大化妆品集团L&#39;OREAL。&nbsp;</p>\r\n\r\n<table style=\"line-height:1.6; width:592px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品名称：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>Lancome/兰蔻&nbsp;清滢嫩肤水(中性)400ML</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>品牌：</strong></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>\r\n			<p>Lancome/兰蔻</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>功效：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>含独特天然保湿物质，让肌肤变得洁净、清爽、滋润，肤色更透明纯净，肌肤更柔软平滑。同时去除老废的角质细胞，让肌肤恢复原本的光泽。</p>\r\n\r\n			<p>透明的化妆水，不但能温和地洁净肌肤，还能给予肌肤适度的湿润。富含独特天然保湿物质，让肌肤变得洁净、清爽、滋润，肤色更透明纯净，肌肤更柔软平滑。清净化妆水能彻底清洁肌肤，给予肌肤湿润，同时去除老废的角质细胞，让肌肤恢复原本的光泽，也帮助后续保养品的吸收更好。清净化妆水（CLARTE）：清净化妆水含从大自然提炼的木瓜和菠萝两种酵素，能帮助老废角质的剥落，让肌肤变得更洁净、透明。</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>商品规格：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>400ml</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>原产国家：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>法国（具体产地以收到实物为准）</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>保质期限：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>3年（具体日期以收到实物为准）</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>适合人群：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>中性及敏感性皮肤</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>产品包装：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>本商品为全新香港专柜售卖商品，包装以香港地区为准</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>使用方法：</strong></p>\r\n			</td>\r\n			<td>\r\n			<p>每日早晚，清洁后的肌肤，倒在手心轻拍于面部或者用化妆棉轻轻擦拭。</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160508/1462708132163701.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160508/1462708134691062.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160508/1462708136151701.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160508/1462708132847418.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'fa-guo-lan-kou-lancomeqing-ying-nen-fu-shui-zhong-xing-400ml-400mlliang-jian-tao-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('1068', '172', '506481', '2016-05-26 14:45:19', '2016-05-26 14:45:19', '2016-05-26 14:45:19', '呼吸魔法眼霜', '<p>&nbsp;</p>\r\n\r\n<p><strong>魔法眼霜 20ml</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>赠品<br />\r\n魔法修复水 20ml<br />\r\n魔法修复乳 20ml<br />\r\n魔法弹力再生精华 8ml<br />\r\n魔法修复面霜 10ml<br />\r\n精华洗面奶 40ml</strong></p>\r\n\r\n<p><strong>功效：</strong>保湿补水，去黑眼圈眼袋，去细纹，增强皮肤弹力的魔法眼霜哦~</p>\r\n\r\n<p><strong>产品介绍：</strong></p>\r\n\r\n<p>不含人工香料、人工色素、合成防腐剂，最大限度地减少因皮肤受刺激而引起的副作用，对皮肤温和、安全，对问题性或敏感性皮肤的护理具有卓越功效。</p>\r\n\r\n<p>优雅而温和的天然成分的香味，以及纯净保湿的配方，使您感觉皮肤在自然呼吸，使用后感觉舒适，心情舒畅。</p>\r\n\r\n<p>本产品含有高浓度Zyen-Y, 经过一千一百一十日的发酵过程制成的Zyen-Y,可发挥超越时光的生命力，提高皮肤本身的再生能力，帮助恢复活力和弹性。</p>\r\n\r\n<p>自然发酵成分和持续提供有效成分的凝露渗透网体统起到互动作用，可改善岁月留下的痕迹，使皮肤段时间内恢复健康和平衡。</p>\r\n\r\n<p><strong>使用感受：</strong>冲着魔法系列的魔力去的~~魔法精华效果那么好，魔法眼霜应该也不会错吧！</p>\r\n\r\n<p>包装延续了呼吸的亮点，很精致的外表。暗红色的花纹，打开之后吗，闻到一种发酵的，淡淡的橙子皮的味道，嘻嘻~ 质地很柔滑，重点涂抹眼角细纹的位置，眼部感觉放松许多。</p>\r\n\r\n<p>经过长时间自然发酵的成分，解决眼角肌肤3大困扰，从肌肤深入抚平凹凸肌肤，赋予眼角肌肤弹性，让线条更生动。</p>\r\n\r\n<p>三大功效:</p>\r\n\r\n<p>1.改善细微皱纹</p>\r\n\r\n<p>2.改善眼周皮肤弹力</p>\r\n\r\n<p>3.改善黑眼圈和眼袋</p>\r\n\r\n<p>产品说明：</p>\r\n\r\n<p>&mdash;&mdash;还原年轻健康的自身肌肤状态.</p>\r\n\r\n<p>&mdash;&mdash;使肌肤充满水分&amp;密度&amp;弹力，变成健康弹性肌肤.</p>\r\n\r\n<p>&mdash;&mdash;活性化肌肤自身机能，塑造充满弹力的弹性肌肤.</p>\r\n\r\n<p>&mdash;&mdash;从发酵起源获得的浓郁发酵成分作用于肌肤根源.</p>\r\n\r\n<p>天然发酵,抗皱去细纹、去黑眼圈、增强皮肤弹力的魔法眼霜<br />\r\n魔法精华成分+专门针对眼部三大顾虑的有效发酵成分，让眼部肌肤更加健康平滑富有弹力，从深处抚平凹凸肌肤，赋予眼角肌肤弹性，质地柔滑，重点涂抹眼角细纹的位置。</p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462749879656524.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462749880539571.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462749880789551.jpg\" /></p>\r\n\r\n<p><img src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160509/1462749880387182.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '0', '', 'hu-xi-mo-fa-yan-shuang-1', '1', '0', '2', '');
INSERT INTO `Product` VALUES ('1069', '172', '507019', '2016-05-26 14:48:34', '2016-05-27 09:40:03', '2016-05-26 14:48:34', '日本FX眼药水银12ml', '<h2>宝贝详情：</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>能够迅速缓解眼睛疲劳干涩和消退红血丝。让你眼睛瞬间黑白分明、清澈明亮、魅力四射。采用独有配方，缓解眼部疲劳，特别是对用眼过度超级有效果。强效清凉感，让眼睛和头脑都迅速得到清爽舒缓，结膜充血状况也迅速消除。对眼睛痒和其他眼部疾病也有预防作用。并能缓解佩戴隐形眼镜而造成的不快。</p>\r\n\r\n<p><strong>注意事项:</strong></p>\r\n\r\n<p>&nbsp;&nbsp;1.&nbsp;密封保存，避免阳光直射&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;2.&nbsp;放置在儿童不易拿到的地方</p>\r\n\r\n<p>&nbsp;&nbsp;3.&nbsp;不要使用其他容器保存&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;4.&nbsp;不要和他人共用</p>\r\n\r\n<p>&nbsp;&nbsp;5.&nbsp;注意产品的保质期限（包装盒下面）</p>\r\n\r\n<p>&nbsp;&nbsp;6.&nbsp;开封后请在2至3个月内用完</p>\r\n\r\n<p>用法与用量：每次1～3滴，每日3～6次</p>\r\n\r\n<p><img alt=\"1462930792305979 (1).jpg\" src=\"https://trading.yilinker.com/ueditor/php/upload/image/20160511/1462948729890933.jpg\" /></p>\r\n\r\n<p><img src=\"https://images-trading.yilinker.com/Products/201605/57327a7b0408e.jpg\" /><img src=\"https://images-trading.yilinker.com/Products/201605/57327a7b0437f.jpg\" /></p>', '0', '', 'ri-ben-fxyan-yao-shui-yin-12ml-1', '1', '0', '2', '');
